import React from 'react';
import './App.css';

class App extends React.Component {
  state = {
    dogList: []
  }

  componentDidMount(){
    fetch("http://localhost:3000/pups")
  }

  render(){ 
    return (
      <div className="App">
        <div id="filter-div">
          <button id="good-dog-filter">Filter good dogs: OFF</button>
        </div>
        <div id="dog-bar">
          <DogContainer
            dogs={this.state.dogs}
          />
        </div>
        <div id="dog-summary-container">
          <h1>DOGGO:</h1>
          <div id="dog-info">
            <DogCard
            />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
